INSERT INTO `master_email_templates` (`id`, `email_type_id`, `master_business_id`, `email_subject`, `email_message`, `notification_message`, `email_parameters`, `status`) VALUES
(1, 1, 1, 'Welcome Dealer Plus', '   <div class="mail_msg">\n        <h5><b>Dear ##DEALERNAME##</b></h5>\n        <p>Congrats! Your account has been created on DealerPlus</p>\n        <p>Please Click Below link to create new Password.</p>\n        <div class="bntdiv">\n           \n                <a href="##changeurl##">Click Here</a>\n           \n        </div>\n    </div>', '', '##changeurl##,##DEALERNAME##,##dealer_user_name##,##dealer_password##,##dealer_code##', 'Inactive'),
(2, 2, 0, 'DMS-Forget Password', '<div class="mail_msg">\n        <h5><b>Dear ##DEALERNAME##</b></h5>\n        \n        <p>Please Click Below link to reset your Password.</p>\n        <div class="bntdiv">\n           \n                <a href="##changeurl##">Click Here</a>\n           \n        </div>\n    </div>', '', '##changeurl##,##DEALERNAME##,##dealer_user_name##,##dealer_password##,##dealer_code##', 'Active'),
(3, 3, 0, 'DMS-Login details', '<div class="mail_msg">         \n<div class="bntdiv">\n          <h5><b> Welcome ##DEALERNAME##</b></h5>\n              <p>User Id: ##dealer_user_name##</p>\n              <p>Dealer code: ##dealer_code##</p>\n              <a href="##changeurl##">Login</a>\n</div>\n</div>', 'Your login details sent.', '##changeurl##,##DEALERNAME##,##dealer_user_name##,##dealer_code##', 'Active'),
